import React from 'react';
import Pokemon from './Pokemon';

class Pokedex extends React.Component {
  render() {

    return(
      <div> 
        {this.props.pokemons.map(pokemon => <Pokemon key={pokemon.id} pok={pokemon} />)}
      </div>
    )
  }
}

export default Pokedex;
